import React from 'react';
import {
  Router,
  Route,
  BrowserRouter,
} from "react-router-dom";
import './App.css';
import Dialogs from './components/Dialogs/Dialogs';
import Header from './components/Header/Header'
import NavBar from './components/NavBar/NavBar';
import Profile from './components/Profile/Profile';

const App = () => {
  let dialogsData =[
    {id: 1, name: "Dima"},
    {id: 2, name: "Ilyas"},
    {id: 3, name: "Vanya"},
    {id: 4, name: "Sasha"},
    {id: 5, name: "Maximilian"}
  ];

  let messagesData =[
    {id: 1, messages: "Hi"},
    {id: 2, messages: "How are you?"},
    {id: 3, messages: "What is your name?"},
  ];

  let Posts =[
    {id: 1, messages: "Hi, how are you", likesCount: 15},
    {id: 2,messages: "it's my first post",likesCount: 20},
  ];

  return (
    <BrowserRouter>
      <div className="app-wrapper">
        <Header />
        <NavBar />
        <div className='app-wrapper-content'>
          <Route path="/profile" render={() => <Profile/>}></Route>
          <Route path="/dialogs" render={() => <Dialogs dialogsData={dialogsData} messagesData={messagesData} Posts={Posts}/>}></Route>
        </div>
      </div>
    </BrowserRouter>

  );
}

export default App;
